  false,\n\t\"url\": null,\n\t\"notes\": \"Tewaukon National Wildlife Refuge (Tewaukon)
  is located near one of only two designated Superfund sites in North Dakota. Extensive
  use of arsenic trioxide during the 1930's and 1940's caused contamination of local
  groundwater and resulted in Superfund designation for a 430 hectare area located
  adjacent to the refuge boundary. This study assessed arsenic and other potentially
  harmful trace element concentrations in fish and wildlife utilizing Tewaukon refuge
  from 1990 to 1992. A total of 53 bird liver samples, 32 fish samples, 19 sediment
  samples, 14 plant samples, 8 coot eggs, and 3 crayfish were chemically analyzed.
  Arsenic concentrations were low in sediments and biota collected from the refuge.
  Seven of 53 (13 percent) of the bird livers analyzed were at or exceeded selenium
  concentrations considered to be elevated. Other elements were at or near background
  concentrations for North Dakota Refuges.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
